import React, { Component } from 'react';
class Table2 extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoaded: true,
            error: null,
            data:[] 
         }
    }
    componentDidMount(){
        console.log("hello");
        fetch("/api/v2/tickers")
        .then((response) => response.json())
        .then((result) => {
            this.setState({
                data: result,
                isLoaded:true
            });
        })
        .catch((error) => {
            this.setState({
                isLoaded:true,
                error
            })
        });
    }

    render() { 
         const {error, isLoaded, data} = this.state;
        

        if (error){
            return <div>Error: {error.message}</div>
        } else if(!isLoaded){
            return <div>Loading...</div>
        }
        else{
            const items = []

            for (var key in data) {
                items.push(
                    <tr>
                <td key={key}></td>
                <td key={key}>{data[key].name}</td>
                <td key={key}>{data[key].last}</td>
                <td key={key}>{data[key].buy}/{data[key].sell}</td>
                <td key={key}>{data[key].volume}</td>
                <td key={key}>{data[key].base_unit}</td>
                </tr>
                )
            }
            return(
                <table>
                    <tr>
                        <th>#</th>
                        <th>name</th>
                        <th>last</th>
                        <th>buy/sell price</th>
                        <th>volume</th>
                        <th>base_unit</th>
                    </tr>
                    {items}
                </table>
                
            )
        }
    }
}
 
export default Table2;
